import sys
import numpy as np
# I have lots of important features in each simulation box defined halfway through the class
# i.e. the number of PLs in the boxes, this should probably be defined in a function near the start 
# of the class for better clarity
# also I really don't think PL concentration and molecules in C5_C5 box need to be state variables at this point because there's only ever one of them
# and actually if I have multiple the proceudre won't work 
# it's getting out of hand now I need to add another thing for the length of the C5_C5 simulations but I've decided
# that they should all be the same length so I'm hard coding it into the class

class Plasticizer:
    def __init__(self, side_chain_length, backbone_length, side_chain_frequency, flexibility, sim_time, sim_type, PL_num, PL_conc):
        self.side_chain_length = side_chain_length
        self.backbone_length = backbone_length
        self.side_chain_frequency = side_chain_frequency
        self.flexibility = flexibility
        self.sim_time = sim_time
        self.sim_type = sim_type
        self.PL_num = PL_num  # number of PL beads in PL/PL box 
        self.PL_conc = PL_conc # concentration of PLs in C_C5 systems 
        
        

    def get_coordinates(self):
        ''' make .gro file for PL and PI file and also returns list of coordinates '''
        
        files = [] # to append the PL and PI files into 

 
        if self.sim_type == "C_C5" or self.sim_type == "C5_C5" or self.sim_type == "C5":

            gro_filename = "plasticizer.gro"
            # open .gro file for writing 
            gro_file = open(gro_filename, "w")
            
            # write .gro file header 
            gro_file.write("Coordinate file for plasticizer\n")
            
            # Set the initial position for the first bead
            
            x_position = 2.4
            y_position = 5
            z_position = 5
    
            coordinates_back = []
            coordinates_side = []
            atom_counter = 0
            side_counter = 0
            
            new_back = self.backbone_length - 2 # taking away 2 beads from the backbone length to avoid PL molecule being on first or last bead
            for i in range(new_back):
                atom_counter += 1
                
                try: # to handle the case of no side chains
                    is_side_chain = (i) % self.side_chain_frequency 
                except ZeroDivisionError:
                    is_side_chain = 0
                    
                if is_side_chain == 0: 
          
                    side_counter += 1 # side counter is to make sure we know which direction to place side chain
                    coordinates_back.append((x_position, y_position, z_position))
                    for j in range(self.side_chain_length):
                        atom_counter += 1
                        if side_counter % 2 == 0:
                            side_bead_x = x_position 
                            side_bead_y = y_position - (j + 1) * 0.4
                            coordinates_side.append((side_bead_x, side_bead_y, z_position))
                        else:
                            side_bead_x = x_position
                            side_bead_y = y_position + (j + 1) * 0.4
                            coordinates_side.append((side_bead_x, side_bead_y, z_position))
                else:
                    coordinates_back.append((x_position, y_position, z_position))
                x_position += 0.4
        
            coordinates_back.insert(0, (2,5,5)) # putting the first backbone bead back 
            end_coord = self.backbone_length*0.4 + 2 - 0.4 
            coordinates_back.append((end_coord, 5, 5))
            # print second line of .gro file 
            
            gro_file.write(str(atom_counter+2) + "\n")
            PI = "PI" # residue name for .gro file
            C5 = "C5" # atom name for .gro file 
            coordinates = coordinates_back + coordinates_side # join coordinates
    
            for i, (x, y, z) in enumerate(coordinates):
                i=int(i+1)
                gro_file.write(f"{1:5d}{PI:5s}{C5:5s}{i:5d}{x:8.3f}{y:8.3f}{z:8.3f}\n")
            
            gro_file.write("   10.0000   10.0000   10.0000\n")
            
            files.append(gro_filename)
            
            gro_file.close()
            
        # making the PI.gro file with a template I already have 
 
        
